import React from 'react'

const Merchandise = (merchandise) => {
    return (
        <div>
            <h3>
                {merchandise}
                {merchandise.Name}
                {merchandise.Count}
            </h3>
            <p>
                {merchandise.Price}
            </p>
        </div>
    )
}

export default Merchandise
